import { FiSearch } from "react-icons/fi";

function NavBar() {
	return (
		<div className="flex justify-between border-2 border-black py-1 px-10 items-center">
			<div className="border">
				<img src="/static/images/BlogPost4.png" alt="Blog Post" className="w-4" />
			</div>
			<div className="flex justify-between w-24">
				<h1>Blog</h1>
				<h1>About</h1>
				<FiSearch />
			</div>
		</div>
	)
}

export default NavBar;
